import Modal from "../UI/Modal";

const Cart = props =>{
    const cartItems= <ul>{[{id:'c1', name:'Sushi', amoount:2,price:12.99},].map((item)=><li>{item.name}</li>)}</ul>;
    return <Modal>
         {cartItems}
         <div className="">
         <div className="text-right gap-4 ">
            <span>Total Amount</span>
            <span className="text-right"> 35.62 </span>
         </div>
         <div className="text-right gap-4 ">
            <button className=" bg-[#F8DE22] border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">Close</button>
            <button className=" ml-3 bg-[#F8DE22] border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">Order</button>
         </div>
         </div>
    </Modal>
};
export default Cart;
